import React, { Component } from "react";
import Header from './Header';

class RegisterPage extends Component {



    render() {
        return(

        <div>
          <Header/>  

        <form>
            <div class="form-group">
             <label for="exampleInputEmail1">Email address</label>
            </div>
        </form>       

        </div>



        );


    }


}

export default RegisterPage;
